INSERT INTO public.processed_data (user_id, interpretation, id, about, portfolio, skills, specialization, github, github_tech_stack, combined_text, coordinator, idea_generator, evaluator, collectivist, perfectionist, executor, formulator, specialist, scout, matched_specializations) VALUES (9421, '[{"name":"Специалист","score":24},{"name":"Формирователь","score":20},{"name":"Доводчик","score":16},{"name":"Оценщик","score":6},{"name":"Реализатор","score":4},{"name":"Генератор идей","score":0},{"name":"Координатор","score":0},{"name":"Разведчик","score":0},{"name":"Коллективист","score":0}]', 9421, '32 года. Недавно ушёл со старой работы, взял курс по JS на Skillfactory, сейчас изучаю вёрстку. Готов работать бесплатно, просто ради опыта. Быстро учусь, голодный к знаниям и новой профессии.', null, 'Нет информации', 'Фронтенд-разработчик', null, null, 'фронтенд-разработчик 32 года. недавно ушёл со старой работы, взял курс по js на skillfactory, сейчас изучаю вёрстку. готов работать бесплатно, просто ради опыта. быстро учусь, голодный к знаниям и новой профессии.', '0.0', '0.0', '0.0', '0.0', '26.67', '0.0', '33.33', '40.0', '0.0', 'фронтенд-разработчик (1.6434)');
INSERT INTO public.processed_data (user_id, interpretation, id, about, portfolio, skills, specialization, github, github_tech_stack, combined_text, coordinator, idea_generator, evaluator, collectivist, perfectionist, executor, formulator, specialist, scout, matched_specializations) VALUES (9422, '[{"name":"Оценщик","score":28},{"name":"Специалист","score":19},{"name":"Координатор","score":13},{"name":"Коллективист","score":5},{"name":"Разведчик","score":5},{"name":"Доводчик","score":0},{"name":"Генератор идей","score":0},{"name":"Формирователь","score":0},{"name":"Реализатор","score":0}]', 9422, e'Всем привет! Меня зовут Юлия. В ИТ я 7 лет, из которых 2 года в разработке тренажерных комплексов и тестовых сценариев для предприятий нефтехимической промышленности и 5 лет в веб-разработке. Базу знаний получила на курсе Geek Brains по профессии Web-разработчик, а их углубление на курсах Hexlet. Первый год в вебе посвятила фуллстек разработке небольших проектов для друзей и знакомых для формирования портфолио, затем более года работала фронтенд разработчиком на израильском стартапе,  последние три года работаю бэкенд разработчиком php+Laravel. Открыта к взаимодействию и общению, возможна подработка в свободное от основной работы время. 
